myApp.controller("search-resultController",["$scope","$http","$routeParams","ApiFactory",function(t,e,o,r){t.query=o.model,t.activity=[],e.get(r.api+"search?q="+t.query+"&limit=10").then(function(e){t.activity=e.data.result,console.log(t.activity.length)},function(t){console.log("Unable to retrieve data from the API :/")})}]);